import React from "react";

import Routes from "./Routes";
import Counter from "./components/Counter";
import Hcard from "./components/home_card";
import Card from "./components/restaurant_card";
import RestCard from "./components/restaurant_card_detail";

function App() {
  return (
    <div>
      <Routes />
      <RestCard />
      <Card />

      <Counter />
    </div>
  );
}

export default App;
